import {
  animate,
  motion,
  useMotionTemplate,
  useMotionValue,
  useSpring,
  useTransform,
} from "framer-motion";
import styled from "@emotion/styled";

export default function InnovatorCard(props) {
  return (
    <Box {...props}>
      <FadeInWhenVisible>
        <DefaultCard
          style={{
            // backgroundImage: sheenGradient,
            aspectRatio: "4/5",
