              <img
                style={{
                  objectFit: "contain",
                  // backgroundColor: "white",
                  borderRadius: 8,
                }}
                src={INNOVATOR_ICON}
              />
            </Box>
            <Box
              sx={{
                flex: 1,
                justifyContent: "center",
                flexDirection: "column",
                minHeight: 0,
              }}
            >
              <Typography
                variant={"h5"}
                fontSize={15}
                fontWeight={700}
                sx={{
                  textTransform: "uppercase",
                  textAlign: "center",
                  letterSpacing: 3,
