              >
                TEAM HEATSIG
              </Typography>
              <Typography
                variant={"h6"}
                fontSize={15}
                fontWeight={500}
                sx={{
                  textTransform: "uppercase",
                  textAlign: "center",
                  letterSpacing: 3,
                  color: "white",
                  m: 0,
                }}
              >
